import React, { useState } from 'react';
import { View, Text, Image, StyleSheet, TouchableOpacity, ScrollView } from 'react-native';

const categories = {
  Dresses: [
    { name: 'Elegant Evening Dress', image: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSrZZJCZE8aJM9skEV9bjHJYp3SP2UYZDCuEA&s' },
    { name: 'Floral Summer Dress', image: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTChn39rpDYlxqvhwEYq8UWDKBKNokJA_s7zA&s' }
  ],
  Tops: [
    { name: 'Casual T-Shirt', image: 'data:image/jpeg;base64,' },
    { name: 'Chic Blouse', image: 'data:image/jpeg;base64,' },
    { name: 'Chic Blouse', image: 'data:image/jpeg;base64,' },
    { name: 'Comfy Sneakers', image: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSPkLOPs2nbKJCz1JpfxztlTyxvp-LSfFM4RA&s' }
  ]
};

const trendingProducts = [
  { name: 'Trendy Handbag', image: 'data:image/jpeg;base64,' },
  { name: 'Classic Sunglasses', image: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS6N2d3h1TDGFBkLXi23oNvW1RewDnRdENIzA&s' },
  { name: 'Designer Watch', image: 'data:image/jpeg;base64,' }
];

const SheinStoreUI = () => {
  const [selectedCategory, setSelectedCategory] = useState(null);

  return (
    <View style={styles.container}>
      {/* Navbar */}
      <View style={styles.navbar}>
        <Text style={styles.navText}>SHEIN</Text>
      </View>
      
      <ScrollView>
        {/* Banner Image */}
        <Image source={{ uri: 'data:image/jpeg;base64,' }} style={styles.banner} />
        
        {/* Trending Now Section */}
        <Text style={styles.sectionTitle}>Trending Now</Text>
        <ScrollView horizontal>
          {trendingProducts.map((product, index) => (
            <View key={index} style={styles.productCard}>
              <Image source={{ uri: product.image }} style={styles.productImage} />
              <Text style={styles.productText}>{product.name}</Text>
            </View>
          ))}
        </ScrollView>
        
        {/* Categories */}
        <Text style={styles.sectionTitle}>Categories</Text>
        <ScrollView horizontal>
          {Object.keys(categories).map((category) => (
            <TouchableOpacity key={category} onPress={() => setSelectedCategory(category)}>
              <View style={styles.category}><Text style={styles.categoryText}>{category}</Text></View>
            </TouchableOpacity>
          ))}
        </ScrollView>
        
        {/* Selected Category Products */}
        {selectedCategory && (
          <View>
            <Text style={styles.sectionTitle}>{selectedCategory}</Text>
            <ScrollView horizontal>
              {categories[selectedCategory].map((product, index) => (
                <View key={index} style={styles.productCard}>
                  <Image source={{ uri: product.image }} style={styles.productImage} />
                  <Text style={styles.productText}>{product.name}</Text>
                </View>
              ))}
            </ScrollView>
          </View>
        )}
      </ScrollView>
      
      {/* Footer */}
      <View style={styles.footer}>
        <Text style={styles.footerText}> 2025 SHEIN | Fashion Redefined</Text>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: { flex: 1, backgroundColor: '#fff' },
  navbar: { backgroundColor: '#FF1493', padding: 15, alignItems: 'center' },
  navText: { fontSize: 20, color: '#fff', fontWeight: 'bold' },
  banner: { width: '100%', height: 150, marginVertical: 10 },
  sectionTitle: { fontSize: 18, fontWeight: 'bold', margin: 10 },
  category: { backgroundColor: '#FFC0CB', padding: 10, margin: 5, borderRadius: 10 },
  categoryText: { fontWeight: 'bold', color: '#333' },
  productCard: { backgroundColor: '#f9f9f9', padding: 10, margin: 5, alignItems: 'center', borderRadius: 10 },
  productImage: { width: 100, height: 100, borderRadius: 10 },
  productText: { marginTop: 5, fontWeight: 'bold' },
  footer: { backgroundColor: '#FF1493', padding: 15, alignItems: 'center', marginTop: 10 },
  footerText: { color: '#fff', fontSize: 12 },
});

export default SheinStoreUI;